		}), UDim.new(0, 5))

		create_rounded(Line, UDim.new(0, 5))

		local can_break = false

		task.spawn(function()
			NoButton.MouseButton1Click:Wait()
			can_break = true
			callback(false, true)
		end)

		task.spawn(function()
			YesButton.MouseButton1Click:Wait()
